import React from "react";

import NodeRenderer from "./NodeRenderer";


function DocumentRenderer({ data }) {
    return (
        <div>
            {data.children.map((node, index) => (
                <NodeRenderer key={index} node={node} />
            ))}
        </div>
    );
}

export default DocumentRenderer;
